import EmployeesListItem from '../employees-list-item/employees-list-item';

import './employees-list.css';

const EmployeesList = (dataListEmployee) => {
  return (
    <ul className="app-list list-group">
      {dataListEmployee.map(item=><EmployeesListItem name={item.name} salary={item.salary}/>)}
      <EmployeesListItem name/>
      <EmployeesListItem />
      <EmployeesListItem />

    </ul>
  );
};

export default EmployeesList;
